function CTweenController(){this.tweenValue=function(n,e,t){return n+t*(e-n)},this.easeLinear=function(n,e,t,r){return t*n/r+e},this.easeInCubic=function(n,e,t,r){var u=(n/=r)*n*n;return e+t*u},this.easeBackInQuart=function(n,e,t,r){var u=(n/=r)*n,i=u*n;return e+t*(2*u*u+2*i+-3*u)},this.easeInBack=function(n,e,t,r){return t*(n/=r)*n*(2.70158*n-1.70158)+e},this.easeOutCubic=function(n,e,t,r){return t*((n=n/r-1)*n*n+1)+e}}